import datetime
from abc import ABC, abstractmethod
from typing import Dict, List, Optional

class Database:
    def __init__(self):
        self._rules = {
            "required_fields": ["title", "description", "agency"],
            "max_length": {"title": 100, "description": 500}
        }
        self._submissions = []
        self._test_issues = []
        self._test_schedules = []

    def load_validation_rules(self) -> Dict:
        return self._rules

    def save_submission(self, submission: Dict) -> None:
        self._submissions.append(submission)

    def get_submissions(self) -> List[Dict]:
        return self._submissions

    def schedule_test(self, test_data: Dict) -> None:
        self._test_schedules.append(test_data)

    def record_test_issue(self, issue: Dict) -> None:
        self._test_issues.append(issue)

    def get_test_issues(self) -> List[Dict]:
        return self._test_issues

    def get_test_schedules(self) -> List[Dict]:
        return self._test_schedules

class Validator:
    def __init__(self, rules: Dict):
        self.rules = rules

    def validate(self, submission: Dict) -> bool:
        for field in self.rules["required_fields"]:
            if field not in submission or not submission[field]:
                return False
        for field, max_len in self.rules["max_length"].items():
            if field in submission and len(str(submission[field])) > max_len:
                return False
        return True

class Submission:
    def __init__(self, data: Dict):
        self.data = data
        self.is_valid = False
        self.is_published = False

    def validate(self, validator: Validator) -> None:
        self.is_valid = validator.validate(self.data)

    def publish(self) -> None:
        if self.is_valid:
            self.is_published = True

class FPDSClient:
    def sync_data(self) -> bool:
        print("Syncing with FPDS data...")
        return True

class FABSProcessor:
    def process_historical_data(self) -> List[Dict]:
        print("Processing historical FABS data...")
        return [{"id": 1, "data": "Sample FABS Data"}]

class FRECCodeDeriver:
    def derive_frec_codes(self, agency_data: Dict) -> str:
        print(f"Deriving FREC code for agency: {agency_data.get('agency')}")
        return "FREC_" + str(agency_data.get('agency', '').upper())

class FundingAgencyCodeDeriver:
    def derive_funding_agency_codes(self, record: Dict) -> str:
        print(f"Deriving funding agency code for record: {record.get('title')}")
        return "FUND_" + str(record.get('title', '').upper())

class DeletionProcessor:
    def process_deletions(self, records: List[Dict]) -> List[Dict]:
        print("Processing deletions...")
        return [{"id": r["id"], "status": "deleted"} for r in records if "id" in r]

class DFileGenerator:
    def generate_d_file(self, submissions: List[Dict]) -> str:
        print("Generating D file for submissions...")
        return "\n".join([str(sub) for sub in submissions])

class TestManager:
    def __init__(self, db: Database):
        self.db = db

    def schedule_user_testing(self, test_data: Dict) -> None:
        self.db.schedule_test(test_data)

    def record_test_issue(self, issue: Dict) -> None:
        self.db.record_test_issue(issue)

    def generate_test_summary(self) -> Dict:
        issues = self.db.get_test_issues()
        schedules = self.db.get_test_schedules()
        return {
            "total_issues": len(issues),
            "total_scheduled_tests": len(schedules),
            "latest_issue": issues[-1] if issues else None,
            "next_test": schedules[0] if schedules else None
        }

class SubmissionSystem:
    def __init__(self):
        self.db = Database()
        self.fpds_client = FPDSClient()
        self.fabs_processor = FABSProcessor()
        self.frec_deriver = FRECCodeDeriver()
        self.funding_deriver = FundingAgencyCodeDeriver()
        self.deletion_processor = DeletionProcessor()
        self.d_file_generator = DFileGenerator()
        self.test_manager = TestManager(self.db)

    def create_submission(self, data: Dict) -> Submission:
        return Submission(data)

    def validate_submission(self, submission: Submission) -> bool:
        rules = self.db.load_validation_rules()
        validator = Validator(rules)
        submission.validate(validator)
        return submission.is_valid

    def publish_submission(self, submission: Submission) -> bool:
        if submission.is_valid:
            submission.publish()
            self.db.save_submission(submission.data)
            return True
        return False

    def process_end_to_end(self, submission_data: Dict) -> Dict:
        submission = self.create_submission(submission_data)
        is_valid = self.validate_submission(submission)
        is_published = self.publish_submission(submission) if is_valid else False
        return {
            "is_valid": is_valid,
            "is_published": is_published,
            "submission": submission.data if is_published else None
        }

    def sync_with_fpds(self) -> bool:
        return self.fpds_client.sync_data()

    def process_historical_fabs(self) -> List[Dict]:
        return self.fabs_processor.process_historical_data()

    def derive_frec_code(self, agency_data: Dict) -> str:
        return self.frec_deriver.derive_frec_codes(agency_data)

    def derive_funding_agency_code(self, record: Dict) -> str:
        return self.funding_deriver.derive_funding_agency_codes(record)

    def process_deletions(self, records: List[Dict]) -> List[Dict]:
        return self.deletion_processor.process_deletions(records)

    def generate_d_file(self) -> str:
        return self.d_file_generator.generate_d_file(self.db.get_submissions())

    def schedule_testing(self, test_data: Dict) -> None:
        self.test_manager.schedule_user_testing(test_data)

    def record_test_issue(self, issue: Dict) -> None:
        self.test_manager.record_test_issue(issue)

    def generate_test_summary(self) -> Dict:
        return self.test_manager.generate_test_summary()

def main():
    system = SubmissionSystem()

    submission_data = {
        "title": "Test Submission",
        "description": "This is a test submission.",
        "agency": "Test Agency"
    }

    result = system.process_end_to_end(submission_data)
    print("Submission Result:", result)

    system.sync_with_fpds()
    system.process_historical_fabs()

    agency_data = {"agency": "Department of Test"}
    frec_code = system.derive_frec_code(agency_data)
    print("FREC Code:", frec_code)

    funding_code = system.derive_funding_agency_code(submission_data)
    print("Funding Agency Code:", funding_code)

    system.process_deletions([{"id": 1, "data": "To be deleted"}])
    d_file = system.generate_d_file()
    print("D File Content:", d_file)

    system.schedule_testing({"test_id": 1, "date": datetime.datetime.now()})
    system.record_test_issue({"issue_id": 1, "description": "UI Bug"})
    test_summary = system.generate_test_summary()
    print("Test Summary:", test_summary)

if __name__ == "__main__":
    main()
